import './Header.css';

function Header() {
    return(
       <header className="header">
         <div className="homeLink">
            <p>Home link</p>
         </div>
         <div className="logo">
            <img src="/images/logo.jpg" alt="site-logo" />
         </div>
         <div className="addLink">
            <p>Add recept</p>
         </div>
       </header> 
    );
};

export default Header;
